import "./App.css";
import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";

class App extends React.PureComponent {
  render() {
    return (
      <div className="App">
        <BrowserRouter>
          <Routes>
            <Route path="/" element="Dashboard" />
          </Routes>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
